import CircularProgress from '@mui/material/CircularProgress';
const Loading = () => {

    return (
            <>
                <div className='fixed inset-0 w-full z-20 bg-white'>
                    <div className='bg-white'>
                        <div className={"iconArea"}>
                            <CircularProgress />
                        </div>
                    </div>
                </div>
            </>
    )
}
export default Loading;
